DROP PROCEDURE IF EXISTS `CheckCustomerReadyOrders`$$
CREATE DEFINER=`fatima6p_factory`@`localhost` PROCEDURE `CheckCustomerReadyOrders` (IN `p_customer_id` INT)   BEGIN

    DECLARE order_count INT;
    DECLARE result_message VARCHAR(255);
    
    SELECT COUNT(*) 
    INTO order_count
    FROM order_request
    WHERE customer_id = p_customer_id 
    AND status = 'Готово';
    IF order_count > 0 THEN
        SET result_message = 'У заказчика готов заказ';
    ELSE
        SET result_message = 'У заказчика нет готовых заказов';
    END IF;

 
    SELECT 
    	
        p_customer_id AS customer_id,
        order_count AS ready_orders_count,
        result_message AS message;

END$$

DROP PROCEDURE IF EXISTS `CreateOrderWithMaterialsAndFurnitura2`$$
CREATE DEFINER=`fatima6p_factory`@`localhost` PROCEDURE `CreateOrderWithMaterialsAndFurnitura2` (IN `p_customer_id` INT, IN `p_product_name` VARCHAR(255), IN `p_material_name` VARCHAR(255), IN `p_furnitura_name` VARCHAR(255), IN `p_width` DECIMAL(10,2), IN `p_length` DECIMAL(10,2), IN `p_quantity` INT)   BEGIN
    DECLARE v_order_request_id INT;
    DECLARE v_order_composition_id INT;
    DECLARE v_product_id INT;
    DECLARE v_material_id INT;
    DECLARE v_furnitura_id INT;

    START TRANSACTION;

   
    INSERT INTO order_request (date, status, customer_id)
    VALUES (NOW(), 'Новый', p_customer_id);
    SET v_order_request_id = LAST_INSERT_ID();

   
    SELECT id INTO v_product_id FROM product WHERE name = p_product_name;
    IF v_product_id IS NULL THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Продукт не найден';
    END IF;

    
    INSERT INTO order_composition (
        order_id, 
        product_id, 
        width, 
        length, 
        quantity, 
        status
    )
    VALUES (
        v_order_request_id,
        v_product_id,
        p_width,
        p_length,
        p_quantity,
        'Новый'
    );
    SET v_order_composition_id = LAST_INSERT_ID();

    
    SELECT id INTO v_material_id FROM material WHERE name = p_material_name;
    IF v_material_id IS NULL THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Материал не найден';
    END IF;

    
    SELECT id INTO v_furnitura_id FROM material WHERE name = p_furnitura_name;
    IF v_furnitura_id IS NULL THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Фурнитура не найдена';
    END IF;

    
    INSERT INTO product_materials (
        order_composition_id, 
        supply_composition_id, 
        quantity
    )
    VALUES (
        v_order_composition_id,
        v_material_id,
        p_quantity
    );

    
    INSERT INTO product_materials (
        order_composition_id, 
        supply_composition_id, 
        quantity
    )
    VALUES (
        v_order_composition_id,
        v_furnitura_id,
        p_quantity
    );

    COMMIT;
END$$

