DROP PROCEDURE IF EXISTS `otmena_zakaza`$$
CREATE DEFINER=`fatima6p_factory`@`localhost` PROCEDURE `otmena_zakaza` (IN `id_order` INT)   BEGIN
    DECLARE current_status VARCHAR(50);

   
    SELECT status INTO current_status
    FROM order_request
    WHERE id = id_order;

    
    IF current_status = 'Новый' THEN
       
        UPDATE order_request
        SET status = 'Отменен'
        WHERE id = id_order;

        
        UPDATE order_composition
        SET status = 'Отменен'
        WHERE order_id = id_order;

        SELECT 'Заказ успешно отменен.' AS message;
    ELSE
        SELECT 'Заказ не может быть отменен, так как его статус не "Новый".' AS message;
    END IF;
END$$

