DROP PROCEDURE IF EXISTS `SearchMaterials`$$
CREATE DEFINER=`fatima6p_factory`@`localhost` PROCEDURE `SearchMaterials` (IN `searchTerm` VARCHAR(255) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci)   BEGIN
    SELECT
        m.name AS material_name,
        m.color,
        mt.name AS material_type_name,
        m.description,
        s.date AS creation_date
    FROM
        material m
    LEFT JOIN
        material_type mt ON m.material_type_id = mt.id
    LEFT JOIN
        supply_composition sc ON m.id = sc.material_id
    LEFT JOIN
        supply s ON sc.supply_id = s.id
    WHERE
        m.name LIKE CONCAT('%', searchTerm, '%')
        OR m.color LIKE CONCAT('%', searchTerm, '%')
        OR mt.name LIKE CONCAT('%', searchTerm, '%')
        OR m.description LIKE CONCAT('%', searchTerm, '%');
END$$

DROP PROCEDURE IF EXISTS `sebestoimost`$$
CREATE DEFINER=`fatima6p_factory`@`localhost` PROCEDURE `sebestoimost` (IN `p_id_order` INT)   BEGIN
    DECLARE material_1 INT;
    DECLARE material_2 INT;
    DECLARE cost_material1 DECIMAL(10,2);
    DECLARE cost_material2 DECIMAL(10,2);
    DECLARE quantiti INT;
    DECLARE length_val DECIMAL(10,2); -- Переименовал, чтобы избежать конфликта с ключевым словом LENGTH
    DECLARE width_val DECIMAL(10,2); -- Переименовал, чтобы избежать конфликта с ключевым словом WIDTH
    DECLARE summa_mat DECIMAL(10,2);
    DECLARE summa DECIMAL(10,2);
    DECLARE remainder1 DECIMAL(10,2);
    DECLARE remainder2 DECIMAL(10,2);
    DECLARE stock_message VARCHAR(255);
    DECLARE insufficient_materials BOOLEAN DEFAULT FALSE;

    -- Получаем материалы.  Используем COALESCE, чтобы избежать NULL
    SELECT COALESCE(id_material, 0), COALESCE(id_furnitura, 0)
    INTO material_1, material_2
    FROM order_composition
    WHERE id = p_id_order
    LIMIT 1;

    -- Получаем стоимость и остатки материалов.  Используем COALESCE, чтобы избежать NULL
    SELECT COALESCE(cost, 0), COALESCE(remainder, 0)
    INTO cost_material1, remainder1
    FROM supply_composition
    WHERE id = material_1
    LIMIT 1;

    SELECT COALESCE(cost, 0), COALESCE(remainder, 0)
    INTO cost_material2, remainder2
    FROM supply_composition
    WHERE id = material_2
    LIMIT 1;

    -- Получаем количество, длину и ширину.  Используем COALESCE, чтобы избежать NULL
    SELECT COALESCE(quantity, 0), COALESCE(length, 0), COALESCE(width, 0)
    INTO quantiti, length_val, width_val
    FROM order_composition
    WHERE id = p_id_order
    LIMIT 1;

    -- Расчет суммы
    SET summa_mat = cost_material1 + cost_material2;
    SET summa = (summa_mat) * 0.75 + 5.00 * (summa_mat) + (length_val * width_val * quantiti);

    -- Проверка на NULL для summa и summa_mat
    IF summa IS NULL OR summa_mat IS NULL THEN
        SET stock_message = 'Материала недостаточно';
        SET insufficient_materials = TRUE;  -- Устанавливаем флаг
    ELSE
        -- Проверка наличия материалов на складе (только если сумма не NULL)
        IF remainder1 < quantiti OR remainder2 < quantiti THEN
            SET insufficient_materials = TRUE;
        END IF;

        -- Формирование сообщения о наличии материалов
        IF insufficient_materials THEN
            SET stock_message = 'Материала недостаточно';
        ELSE
            SET stock_message = 'Есть на складе';
        END IF;
    END IF;


    -- Вывод результатов
    SELECT p_id_order AS id_order, summa_mat, summa, stock_message;

END$$

