DROP TRIGGER IF EXISTS `trigger_calculate_total_price`;
DELIMITER $$
CREATE TRIGGER `trigger_calculate_total_price` BEFORE UPDATE ON `order_request` FOR EACH ROW BEGIN
    SET NEW.total_price = NEW.cost_price * (1 + 0.75 + (1.75 * 0.40));
END
$$
DELIMITER ;

