CREATE ALGORITHM=UNDEFINED DEFINER=`fatima6p_factory`@`localhost` SQL SECURITY DEFINER VIEW `item_details_view`  AS SELECT `m`.`name` AS `material_name`, `m`.`color` AS `color`, `mt`.`name` AS `material_type_name`, `m`.`description` AS `description`, `p`.`model` AS `model`, `u`.`name` AS `unit_of_measure`, `l`.`row_number` AS `row_numberr`, `l`.`shelf_number` AS `shelf_numberr` FROM ((((`material` `m` join `material_type` `mt` on((`m`.`material_type_id` = `mt`.`id`))) left join `product` `p` on((`m`.`id` = `p`.`id`))) left join `unit_of_measure` `u` on((`mt`.`unit_of_measure_id` = `u`.`id`))) left join `location` `l` on((`m`.`id` = `l`.`id`)))) ;

