CREATE ALGORITHM=UNDEFINED DEFINER=`fatima6p_factory`@`localhost` SQL SECURITY DEFINER VIEW `material_view`  AS SELECT `m`.`name` AS `material_name`, `mt`.`name` AS `material_type_name`, `m`.`color` AS `color`, `m`.`description` AS `description`, `s`.`date` AS `creation_date`, `sc`.`remainder` AS `remainder` FROM (((`material` `m` left join `material_type` `mt` on((`m`.`material_type_id` = `mt`.`id`))) left join `supply_composition` `sc` on((`m`.`id` = `sc`.`material_id`))) left join `supply` `s` on((`sc`.`supply_id` = `s`.`id`)))) ;

