CREATE ALGORITHM=UNDEFINED DEFINER=`fatima6p_factory`@`localhost` SQL SECURITY DEFINER VIEW `supplier_details_view`  AS SELECT `s`.`organization_name` AS `name`, `s`.`inn` AS `inn`, `ot`.`name` AS `organization_type`, concat(`s`.`director_first_name`,' ',`s`.`director_last_name`,' ',`s`.`director_middle_name`) AS `director_full_name`, `s`.`kpp` AS `kpp`, `s`.`ogrn` AS `ogrn`, `s`.`email` AS `email`, `s`.`address` AS `address` FROM (`supplier` `s` join `organization_type` `ot` on((`s`.`organization_type_id` = `ot`.`id`)))) ;

