CREATE ALGORITHM=UNDEFINED DEFINER=`fatima6p_factory`@`localhost` SQL SECURITY DEFINER VIEW `supply_details_view`  AS SELECT `e`.`first_name` AS `employee_first_name`, `e`.`last_name` AS `employee_last_name`, `s`.`organization_name` AS `supplier_name`, `p`.`name` AS `product_name`, `sc`.`quantity` AS `quantity`, `sc`.`cost` AS `total_amount`, `su`.`date` AS `supply_date` FROM (((((`supply` `su` join `employee` `e` on((`su`.`employee_id` = `e`.`id`))) join `supplier` `s` on((`su`.`supplier_id` = `s`.`id`))) join `supply_composition` `sc` on((`su`.`id` = `sc`.`supply_id`))) join `material` `m` on((`sc`.`material_id` = `m`.`id`))) join `product` `p` on((`m`.`id` = `p`.`id`)))) ;

